import React from 'react';
import { Link } from 'react-router-dom';
import { useDispatch } from 'react-redux';


function Reparti(props) {
    const dispatch = useDispatch();
    const {reparti} = props;
    const qytetId = props.qytetId;
    const spitaliId = props.spitaliId;
   

    const onDeleteTaskClik = (departmentId,employeeId,taskId) =>{
        dispatch(deleteReparti(departmentId,employeeId,taskId));
        window.location.reload();
    }

    return (
        <div className='container d-flex flex-row'>
            <div className='card card-body'>
                <div className='row'>
                    <div className='col-md-9'>
                        <div className='container'>
                            <h2>{reparti.name}</h2>
                        </div>
                    </div>
                    <div className='col-md-3'>
                        <ul className='list-group d-flex flex-column'>
                            <Link to={`/employeeList/${reparti.id}`} className='list-group-item'>
                                Qyteti board
                            </Link>
                            <Link to={`/updateQytetiform/${reparti.id}`} className='list-group-item'>
                                Update board
                            </Link>
                            <button
                                onClick={() => onDeleteTaskClik(qytetId, spitaliId, reparti.id)}
                                className='list-group-item list-group-item-action'
                            >
                                Delete board
                            </button>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Reparti;
